    false,nt"url": null,nt"notes": "There is a need to re-focus attention and
    effort toward refuge uplands and insure that this important portion of refuge habitat
    is effectively managed to achieve the refuge purposes and objectives.This assessment
    covers all current permitted activities and other management actions which could
    be used to achieve habitat objectives for birds and other wildlife on the refuge
    uplands at Browns Park National Wildlife Refuge.  This document contains an Environmental
    Action Memorandum and FONSI determing that the action of implementing the Prescriptive
    Management - Including All Tools Alternative of Upland Habitat Management is determined
    to have no significant environmental effects.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
